
const targetWords = '';
const words = ''

export default class Dictionary {
  static getWord(array, index) {
    const i5 = index*5;
    return array.slice(i5,i5+5);
  }

  static binSearch(array, word) {
    const count = array.length/5;
    let lowIndex = 0;
    let highIndex = count - 1;
    while (lowIndex <= highIndex) {
        const midIndex = Math.trunc((lowIndex + highIndex)/2);
        if (this.getWord(array, midIndex) > word) {
            highIndex = midIndex - 1;
        } else {
            lowIndex = midIndex + 1;
        }
    }
    return highIndex >= 0 && word === this.getWord(array, highIndex);
  }

  static randomWord() {
    const count = (targetWords.length / 5)-1;
    const index = Math.trunc(Math.random()*count);
    return this.getWord(targetWords, index);
  }

  static isWord(word) {
    return this.binSearch(words, word);
  }

  static checkStates(targetWord, guess) {
    const checkStates = new Array(5).fill("incorrect");
    const letters = guess.split('');
    const targetLetters = targetWord.split('');
    for (let i=0; i<5; i++) {
      if (targetLetters[i] === letters[i]) {
        checkStates[i] = "correct";
        targetLetters[i] = '';
        letters[i] = '';
      }
    }
    for (let i=0; i<5; i++) {
      if (!letters[i]) continue;
      let fi = targetLetters.findIndex(t => t===letters[i]);
      if (fi > -1) {
        checkStates[i] = "contains";
        targetLetters[fi] = '';
      }
    }
    return checkStates;
  }

}